import {useState} from "react";
import Nav from "../components/Nav";

const OnBoarding = () => {



    const handleSubmit = () =>{
        console.log('submitted')
    }

    const handleChange = () =>{
        console.log('change')
    }

    return (
        <>
            <Nav
                minimal={true}
                setShowModal={() => {} }
                showModal={false}
            />
            <div className="onboarding">
                <h2>CREATE ACCOUNT</h2>
                <form onSubmit={handleSubmit}>
                    <section>
                        <lable htmlFor="first_name">First Name</lable>
                        <input
                            id="first_name"
                            type="text"
                            name="first_name"
                            placeholder="First Name"
                            required={true}
                            value={""}
                            onChange={handleChange}
                        />

                        <lable>Birthday</lable>
                        <div className="multiple-input-container">
                        <input
                            id="dob_day"
                            type="number"
                            name="dob_day"
                            placeholder="DD"
                            required={true}
                            value={""}
                            onChange={handleChange}
                        />
                        <input
                            id="dob_month"
                            type="number"
                            name="dob_month"
                            placeholder="MM"
                            required={true}
                            value={""}
                            onChange={handleChange}
                        />
                        <input
                            id="dob_year"
                            type="number"
                            name="dob_year"
                            placeholder="YYYY"
                            required={true}
                            value={""}
                            onChange={handleChange}
                        />
                        </div>

                        <lable>Gender</lable>
                        <div className="multiple-input-container">
                        <input
                            id="man-gender-identity"
                            type="radio"
                            name="gender_identity"
                            value={"man"}
                            onChange={handleChange}
                            checked={false}
                        />
                            <lable htmlFor="man-gender-identity">Man</lable>
                            <input
                                id="woman-gender-identity"
                                type="radio"
                                name="gender_identity"
                                value={"woman"}
                                onChange={handleChange}
                                checked={false}
                            />
                            <lable htmlFor="woman-gender-identity">Woman</lable>
                            <input
                                id="more-gender-identity"
                                type="radio"
                                name="gender_identity"
                                value={"more"}
                                onChange={handleChange}
                                checked={false}
                            />
                            <lable htmlFor="more-gender-identity">More</lable>
                        </div>

                        <lable htmlFor="show-gender">Show gender on my profile</lable>
                        <input
                            id="show-gender"
                            type="checkbox"
                            name="show_gender"
                            onChange={handleChange}
                            checked={false}
                        />


                    </section>
                </form>
            </div>
        </>
    )
}
export default OnBoarding
